import React from 'react'
import '../'

 const Login = () => {
  return (
    <div className='container'>
      <h1>Login</h1>
          <div>
            <input type='text' />
            <input type='password' />
            <input type='submit' />
          </div>
    </div>
  )
}
export default Login;
